import React from "react";
import "./Editable.css";

function Edit(props) {
  return (
    <div className="editable">
      <div className="editable_display_wrapper">
        {Array.isArray(props.board) ? (
          <div className="editable_display_boards">
            {props.board.map((boardName) => (
              <p
                key={boardName}
                className={`editable_display ${
                  props.displayClass ? props.displayClass : ""
                }`}
              >
                {boardName}
              </p>
            ))}
          </div>
        ) : (
          <p
            className={`editable_display ${
              props.displayClass ? props.displayClass : ""
            }`}
          >
            {props.text}
          </p>
        )}
      </div>
    </div>
  );
}

export default Edit;
